  align-items: flex-start;
  justify-content: center;
  padding: 0px 0px var(--padding-base);
  gap: 0px 5px;
  max-width: 100%;
  @media screen and (max-width: 450px) {
    flex-wrap: wrap;
  }
`;
const Div2 = styled.div`
  flex: 1;
  position: relative;
  font-weight: 500;
  display: inline-block;
  min-width: 96px;
  max-width: 100%;
`;
